import styled from "styled-components";

export const Container = styled.div`
  border: 1px solid red;
  margin: 0 auto;
  background: grey;
  display: flex;
  justify-content: center;
  width: 100%;
  align-items: center;
  height: 100vh;
  table button {
    cursor: pointer;
    background: gray;
    border: 1px solid black;
    margin-top: 10px;
  }
  table td {
    padding: 10px;
  }
`;

export const Wrapper = styled.div`
  width: 100%;
`;
export const TableBtnWrapper = styled`
    display: flex;
    align-items: center;
`
